def permutations(array)
  if array.is_a? String
    array = array.split("")
  end
  return [array] if array.length <= 1


  # Similar to the subsets problem, we observe that to get the permutations
  # of [1, 2, 3] we can look at the permutations of [1, 2] which are
  # [1, 2] and [2, 1] and add the last element to every possible index getting
  # [3, 1, 2], [1, 3, 2], [1, 2, 3], [3, 2, 1], [2, 3, 1]

  # pop off the last element
  first = array.shift
  # make the recursive call
  perms = permutations(array)
  # we will need an array to store all our different permutations
  total_permutations = []


  # Now we iterate over the result of our recusive call say [[1, 2], [2, 1]]
  # and for each permutation add first into every index. This new subarray
  # gets added to total_permutations.
  perms.each do |perm|
    (0..perm.length).each do |i|
      total_permutations << perm[0 ... i] + [first] + perm[i .. -1]
    end
  end
  total_permutations
end
def permutations(str)
  return str if str.length <= 1

  permutation_array = []

  last_letter = str[-1]

  incomplete_permutations = []
  incomplete_permutations << permutations(str[0..-2])

  incomplete_permutations.each do |permutation|
    permutation.length.times do |i|
      # byebug
      permutation_array << (permutation[0...i].to_s + last_letter + permutation[i..-1].to_s )
    end
  end

  permutation_array
end

def bad_two_sum?(array)
  array.each do |el|
    array.each do |el2|
      next if el2 == el
      return true if el + el2 == 0
    end
  end
  false
end
